export const styles = {
    "profile": {
      "display": "flex",
    },
    "profileRight": {
      "flex": "9",
      background: '#1b2439',
      position: 'relative'
    },
    "profileCover": {
      "height": "320px",
      "position": "relative"
    },
    "profileCoverImg": {
      "width": "100%",
      "height": "100%",
      "objectFit": "cover"
    },
    "profileUserImg": {
      "width": "150px",
      "height": "150px",
      "borderRadius": "50%",
      "objectFit": "cover",
      "position": "absolute",
      "left": "0",
      "right": "0",
      "margin": "auto",
      "top": "150px",
    },
    "profileInfo": {
      "display": "flex",
      padding: '15px 0px',
      "flexDirection": "column",
      "alignItems": "center",
      "justifyContent": "center",
      background: '#1b2439'
    },
    "profileInfoName": {
      "fontSize": "24px",
      color: '#d0d3db'
    },
    "profileInfoDesc": {
      "fontWeight": "400",
      fontSize: '17px',
      color: '#d0d1ca',
      letterSpacing: '.5px',
      marginTop: '5px'
    },
    "profileRightBottom": {
      "display": "flex",
    }
  }
